'use client';
import { useEffect, useState, useRef } from 'react';import { io } from 'socket.io-client';
const socket = io('http://localhost:8081');const currentUserId = 2;
export default function ChatPage() {    const [users, setUsers] = useState([]);    const [selectedUserId, setSelectedUserId] = useState(null);    const [messages, setMessages] = useState([]);    const [message, setMessage] = useState('');    const messagesEndRef = useRef(null);
    const scrollToBottom = () => {        messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });    };
    useEffect(() => {        fetch(`http://localhost:8081/api/v1/chat/contacts/${currentUserId}`)            .then(res => res.json())            .then(data => setUsers(data));    }, []);
    useEffect(() => {        if (!selectedUserId) return;        fetch(`http://localhost:8081/api/v1/chat/between/${currentUserId}/${selectedUserId}`)            .then(res => res.json())            .then(data => {                setMessages(data);                scrollToBottom();            });    }, [selectedUserId]);
    useEffect(() => {        const handleReceive = msg => {            if (selectedUserId && ((msg.senderId === currentUserId && msg.receiverId === selectedUserId) || (msg.senderId === selectedUserId && msg.receiverId === currentUserId))) {                setMessages(prev => [...prev, msg]);                scrollToBottom();            }        };
        socket.on('receive_message', handleReceive);        return () => socket.off('receive_message', handleReceive);    }, [selectedUserId]);
    const sendMessage = () => {        if (!message.trim() || !selectedUserId) return;        const msg = { senderId: currentUserId, receiverId: selectedUserId, content: message };        socket.emit('send_message', msg);        setMessage('');    };
    const handleKeyDown = e => {        if (e.key === 'Enter') {            e.preventDefault();            sendMessage();        }    };
    return (                    {/* Contacts Sidebar */}                            Contacts                                    {users.map((user, i) => (                         setSelectedUserId(user.id)} className={`w-full text-left px-4 py-3 rounded-lg transition ${selectedUserId === user.id ? 'bg-blue-600 text-white' : 'bg-gray-700 hover:bg-gray-600'}`}>                            {user?.name}                            {user?.email}                                            ))}                            
            {/* Chat Window */}                                                {messages.map((msg, idx) => {                        const isCurrentUser = msg.sender?.id === currentUserId || msg.senderId === currentUserId;                        return (                                                            {msg.content}                                {isCurrentUser ? 'You' : `User ${msg.sender?.id || msg.senderId}`}                                                    );                    })}                                    
                {/* Message Input */}                                                             setMessage(e.target.value)} onKeyDown={handleKeyDown} className='flex-1 bg-gray-700 border border-gray-600 rounded-lg px-4 py-2 text-sm placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500' placeholder='Type your message...' />                                                    Send                                                                                    );}

